angular.module("templates").run(["$templateCache",function($templateCache){$templateCache.put("home.html","<div class='container'>\n  <div class='row'>\n    <div class='col-md-12'>\n      <div class='centered'>\n        <h1 class='blackshade-text'>\n          Survey Responses\n        </h1>\n      </div>\n      <div class='table-responsive'>\n        <table class='table table-hover'>\n          <thead>\n            <tr>\n              <th>Name</th>\n              <th>Email</th>\n            </tr>\n          </thead>\n          <tbody ng-repeat='user in users'>\n            <tr ng-click='showMore = !showMore'>\n              <td>\n                {{ user.firstname + ' ' + user.lastname }}\n              </td>\n              <td>\n                {{ user.email }}\n              </td>\n            </tr>\n            <tr ng-show='showMore'>\n              <td colspan='2'>\n                <ul>\n                  <li class='list-unstyled' ng-repeat='response in user.response track by $index'>\n                    {{ response['question'] }}\n                    <strong>\n                      {{ response['answer'] }}\n                    </strong>\n                  </li>\n                </ul>\n              </td>\n            </tr>\n          </tbody>\n        </table>\n      </div>\n    </div>\n  </div>\n</div>\n<!-- %a(href=\"\" ng-click=\"deleteUser(user.id, $index)\") Remove -->")}]);